export type getArticlesResponse200 = {
  data: GetArticles200;
  status: 200;
};

export type getArticlesResponseSuccess = getArticlesResponse200 & {
  headers: Headers;
};
export type getArticlesResponse = getArticlesResponseSuccess;

export const getGetArticlesUrl = (params?: GetArticlesParams) => {
  const normalizedParams = new URLSearchParams();

  Object.entries(params || {}).forEach(([key, value]) => {
    if (value !== undefined) {
      normalizedParams.append(key, value === null ? 'null' : value.toString());
    }
  });

  const stringifiedParams = normalizedParams.toString();

  return stringifiedParams.length > 0
    ? `/v1/articles?${stringifiedParams}`
    : `/v1/articles`;
};

